import "../jass.css";
import Footer from "./footer";
import Header from "./header";

const page="about";

//var pageHtml = "";
function renderPage(page){
    if (page==="about"){
        return(
            <div>
                <h1>About me</h1>
            <img src="../public/Me.JPG" alt="Me"></img>
            <p>say stuff about me</p>
            </div>
            
        )
    }
}

function Portfolio(){
    return(
        
<body>
    <Header currentPage={page} renderPage={renderPage}/>
    <div class="project">
        {renderPage}
    </div>

    
        <Footer/>
</body>
    )
}

export default Portfolio;
